IF OBJECT_ID('dbo.proc_transform_462', 'P') IS NOT NULL
    DROP PROCEDURE dbo.proc_transform_462;
GO
CREATE PROCEDURE dbo.proc_transform_462
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_462
    SET payload = LEFT(payload, 1000) + N'|V4-462|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_462;
END
